import { Component, OnInit } from '@angular/core';
import { welcomeFunction } from 'src/app/welcomemenu.js';

@Component({
  selector: 'app-new-welcome',
  templateUrl: './new-welcome.component.html',
  styleUrls: ['./new-welcome.component.css']
})
export class NewWelcomeComponent implements OnInit {

  constructor() { }

  ngOnInit(): void {
    welcomeFunction();
  }

}
<div id="menu">
  <div id="menu-items">
    <!-- Itemki z menu -->
    <div class="menu-item" [routerLink]="['/welcome']" >Strona główna</div>
    <div class="menu-item" [routerLink]="['/places']" >Atrakcje</div>
    <div class="menu-item" [routerLink]="['/about']">O naszej stronie</div>
    <div class="menu-item" [routerLink]="['/contact']">Kontakt</div>
  </div>
  <div id="menu-background-pattern"></div>
  <div id="menu-background-image"></div>
</div>

<a id="source-link" class="meta-link" href="https://dev.azure.com/olkowskik/pomorzenadwislanskie/_git/pomorzenadw-vapril" target="_blank">
  <i class="fa-solid fa-link"></i>
  <span>Repozytorium Azure <img src="../../assets/images/devops.png" alt="Azure DevOps Logo" height="100%"/></span>
</a>
